import "./App.scss";
import axios from 'axios';
import React from "react";
import SearchBar from "./components/Search/Search";

class App extends React.Component {
  onSearchSubmit = async(term) => {
    const response = axios.get('https://api.unsplash.com/search/photos', {
      params: { query: term },
      headers: {
        Authorization: 'Client-ID dBpXovVafx_tZ-cN-SFPF_ji8UBkqGu-x9MHO_x1-y8'
      }
    })
    .then((response) => {
      // Handle the response data here, e.g., update the state with the fetched data
      console.log(response.data); // For now, we'll just log the data to the console
    })
    .catch((error) => {
      // Handle any errors that occurred during the API call
      console.error('Error fetching data:', error);
    });
  }

  render() {
    return (
      <div>
        <SearchBar onSubmit={this.onSearchSubmit}></SearchBar>
      </div>
    )
  }
}

export default App;
